import s from "./Nav.module.css"

function Nav (props) {
    return (
      <div className={s.nav_wrapper}>
        <div className={s.logo}>
          <h1>Logo</h1>
        </div>
        <div className={s.nav_menu}>
          <ul className={s.list}>
            <li>Profile</li>
            <li>Dialogs</li>
            <li>Audio</li>
          </ul>
        </div>
      </div>
    );
}

export default Nav;
